import { BrowserRouter, Route} from "react-router-dom";
import Home from "./components/home";
import Topnav from "./components/topnav";


function App() {
  return (
    <BrowserRouter>
        <Route exact path="/">
          <Topnav/>
          <Home />
        </Route>
    </BrowserRouter>
  );
}

export default App;
